//Function to initialize pointers to CheckBox widget pointers
void GNSS_CS_IGF_Advanced::InitPushButtonGNSSPointers(){
    PushButtonGNSS[GPS]=uiCSIGF->pushButtonGPS;
    PushButtonGNSS[Galileo]=uiCSIGF->pushButtonGalileo;
    PushButtonGNSS[GLONASS]=uiCSIGF->pushButtonGLONASS;
    PushButtonGNSS[GEO]=uiCSIGF->pushButtonGEO;
    PushButtonGNSS[BDS]=uiCSIGF->pushButtonBDS;
    PushButtonGNSS[QZSS]=uiCSIGF->pushButtonQZSS;
    PushButtonGNSS[IRNSS]=uiCSIGF->pushButtonIRNSS;
}

//Function to initialize pointers to pushButton GNSS Measurements _clicked() functions
void GNSS_CS_IGF_Advanced::InitPushButtonGNSSMinFuncPointers(){
    PushButtonGNSSFunctions[GPS]=&GNSS_CS_IGF_Advanced::on_pushButtonGPS_clicked;
    PushButtonGNSSFunctions[Galileo]=&GNSS_CS_IGF_Advanced::on_pushButtonGalileo_clicked;
    PushButtonGNSSFunctions[GLONASS]=&GNSS_CS_IGF_Advanced::on_pushButtonGLONASS_clicked;
    PushButtonGNSSFunctions[GEO]=&GNSS_CS_IGF_Advanced::on_pushButtonGEO_clicked;
    PushButtonGNSSFunctions[BDS]=&GNSS_CS_IGF_Advanced::on_pushButtonBDS_clicked;
    PushButtonGNSSFunctions[QZSS]=&GNSS_CS_IGF_Advanced::on_pushButtonQZSS_clicked;
    PushButtonGNSSFunctions[IRNSS]=&GNSS_CS_IGF_Advanced::on_pushButtonIRNSS_clicked;
}
