// Set all defaults
void GNSS_CS_IGF_Advanced::setCSdefaults(){
    this->SetDefaultGPS();
    this->SetDefaultGalileo();
    this->SetDefaultGLONASS();
    this->SetDefaultGEO();
    this->SetDefaultBDS();
    this->SetDefaultQZSS();
    this->SetDefaultIRNSS();
}


int GNSS_CS_IGF_Advanced::checkFreqRepeat(int iPhase1,int iPhase2,int iPhase3,int iPhase4){
    if (TripleQuadruple==0){ //Triple-frenquency
        if ( (iPhase1>0&&iPhase2>0&&iPhase3>0) && (iPhase1==iPhase2||iPhase2==iPhase3||iPhase3==iPhase1) ) return 1;
        else return 0;
    } else if (TripleQuadruple==1){ //Quadruple-frenquency
        if ( (iPhase1>0&&iPhase2>0&&iPhase3>0&&iPhase4>0) && ((iPhase1==iPhase2&&iPhase2==iPhase3) || (iPhase2==iPhase3&&iPhase3==iPhase4) || (iPhase3==iPhase4&&iPhase4==iPhase1) || (iPhase4==iPhase1&&iPhase1==iPhase2))) {
            return 1;
        }
        else return 0;
    }
    else return 0;
}

//GPS
void GNSS_CS_IGF_Advanced::SetDefaultGPS(){
    uiCSIGF->frameIGFComb2GPS->setHidden(true);
    uiCSIGF->frameIGFComb3GPS->setHidden(true);
    uiCSIGF->pushButtonIGFGPSAdd->setEnabled(true);
    uiCSIGF->pushButtonIGFGPSDel->setEnabled(false);
    this->on_comboBoxIGFComb1Freq1GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb1Freq2GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb1Freq3GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb1Freq4GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb2Freq1GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb2Freq2GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb2Freq3GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb2Freq4GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb3Freq1GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb3Freq2GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb3Freq3GPS_currentIndexChanged(0);
    this->on_comboBoxIGFComb3Freq4GPS_currentIndexChanged(0);
}
