void GNSS_CS_IGF_Advanced::on_pushButtonIGFGalileoAdd_clicked(){
    if (uiCSIGF->frameIGFComb2Galileo->isHidden()==true){
        uiCSIGF->frameIGFComb2Galileo->setHidden(false);
        uiCSIGF->pushButtonIGFGalileoDel->setEnabled(true);
    } else if (uiCSIGF->frameIGFComb3Galileo->isHidden()==true){
        uiCSIGF->frameIGFComb3Galileo->setHidden(false);
        uiCSIGF->pushButtonIGFGalileoAdd->setEnabled(false);
    }
}
