//Function to get IGF command options
int GNSS_CS_IGF_Advanced::getgLABOptions(QString *errorString, QString *warningString, QString *saveString, QStringList *runString){
    QString freqOption="",measOption="";
    QStringList freqOptionList, measOptionList;
    int paramCount=0;
    int numFreqOptionList=0, numMeasOptionList=0;
    int skipIteration[MAX_GNSS][3]={{0}};
    int multipleAuto[MAX_GNSS]={0};
    if (warningString->length()<0) *warningString=""; //only to avoid the warning of unused "warningString"
    if (errorString->length()<0) *errorString=""; //only to avoid the warning of unused "warningString"
    //loop of constellations
    for (int gnssi=0; gnssi<MAX_GNSS; gnssi++){
        //Look for repeated combinations in iteration 2
        if (FrameCombGNSS[gnssi][1]->isHidden()==false) {
            if ( ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()==0 && ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()==0){
                *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has multiple 'Auto' iterations, but only one will be applied. Set only one 'Auto' iteration.\n";
                skipIteration[gnssi][1]=1;
                multipleAuto[gnssi]=1;
            } else if (ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()!=0 && ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()!=0) {
                int freq1=ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()-1;
                int freq11=ComboBoxFreqGNSS[gnssi][1][1]->currentIndex()-1;
                int freq12=ComboBoxFreqGNSS[gnssi][1][2]->currentIndex()-1;
                int freq13=ComboBoxFreqGNSS[gnssi][1][3]->currentIndex()-1;
                int freq0=ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()-1;
                int freq01=ComboBoxFreqGNSS[gnssi][0][1]->currentIndex()-1;
                int freq02=ComboBoxFreqGNSS[gnssi][0][2]->currentIndex()-1;
                int freq03=ComboBoxFreqGNSS[gnssi][0][3]->currentIndex()-1;

                if (TripleQuadruple==0) {
                    if (freq1==freq0 && freq11==freq01 && freq12==freq02) {
                        if (ComboBoxMeasGNSS[gnssi][1][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][0][freq0]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][1][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][1][freq01]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][1][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][2][freq02]->currentIndex() ) {
                            *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has iterations 1 and 2 repeated. They will be used only once.\n";
                            skipIteration[gnssi][1]=1;
                        }
                    }
                } else {
                    if (freq1==freq0 && freq11==freq01 && freq12==freq02 && freq13==freq03) {
                        if (ComboBoxMeasGNSS[gnssi][1][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][0][freq0]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][1][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][1][freq01]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][1][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][2][freq02]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][1][3][freq13]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][3][freq03]->currentIndex()) {
                            *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has iterations 1 and 2 repeated. They will be used only once.\n";
                            skipIteration[gnssi][1]=1;
                        }
                    }
                }
            }
            if (FrameCombGNSS[gnssi][2]->isHidden()==false) {
                if ( ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()==0 && ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()==0 ) {
                    if (multipleAuto[gnssi]==0) {
                        *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has multiple 'Auto' iterations, but only one will be applied. Set only one 'Auto' iteration.\n";
                    }
                    skipIteration[gnssi][2]=1;
                    multipleAuto[gnssi]=1;
                } else if (ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()!=0 && ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()!=0) {
                    int freq1=ComboBoxFreqGNSS[gnssi][1][0]->currentIndex()-1;
                    int freq11=ComboBoxFreqGNSS[gnssi][1][1]->currentIndex()-1;
                    int freq12=ComboBoxFreqGNSS[gnssi][1][2]->currentIndex()-1;
                    int freq13=ComboBoxFreqGNSS[gnssi][1][3]->currentIndex()-1;
                    int freq0=ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()-1;
                    int freq01=ComboBoxFreqGNSS[gnssi][2][1]->currentIndex()-1;
                    int freq02=ComboBoxFreqGNSS[gnssi][2][2]->currentIndex()-1;
                    int freq03=ComboBoxFreqGNSS[gnssi][2][3]->currentIndex()-1;

                    if (TripleQuadruple==0) {
                        if (freq1==freq0 && freq11==freq01 && freq12==freq02 ) {
                            if (ComboBoxMeasGNSS[gnssi][1][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][0][freq0]->currentIndex()
                                    && ComboBoxMeasGNSS[gnssi][1][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][1][freq01]->currentIndex()
                                    && ComboBoxMeasGNSS[gnssi][1][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][2][freq02]->currentIndex()) {
                                *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has iterations 2 and 3 repeated. They will be used only once.\n";
                                skipIteration[gnssi][2]=1;
                            }
                        }
                    } else {
                        if (freq1==freq0 && freq11==freq01 && freq12==freq02 && freq13==freq03) {
                            if (ComboBoxMeasGNSS[gnssi][1][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][0][freq0]->currentIndex()
                                    && ComboBoxMeasGNSS[gnssi][1][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][1][freq01]->currentIndex()
                                    && ComboBoxMeasGNSS[gnssi][1][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][2][freq02]->currentIndex()
                                    && ComboBoxMeasGNSS[gnssi][1][3][freq13]->currentIndex()==ComboBoxMeasGNSS[gnssi][2][3][freq03]->currentIndex()) {
                                *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has iterations 2 and 3 repeated. They will be used only once.\n";
                                skipIteration[gnssi][2]=1;
                            }
                        }
                    }
                }
            }
        }
        //Look for repeated combinations in iteration 3
        if (FrameCombGNSS[gnssi][2]->isHidden()==false && skipIteration[gnssi][2]==0) {
            if ( ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()==0 && ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()==0) {
                if (multipleAuto[gnssi]==0) {
                    *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in IGF cycle-slip detector has multiple 'Auto' iterations, but only one will be applied. Set only one 'Auto' iteration.\n";
                }
                skipIteration[gnssi][2]=1;
                multipleAuto[gnssi]=1;
            } else if (ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()!=0 && ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()!=0) {
                int freq1=ComboBoxFreqGNSS[gnssi][2][0]->currentIndex()-1;
                int freq11=ComboBoxFreqGNSS[gnssi][2][1]->currentIndex()-1;
                int freq12=ComboBoxFreqGNSS[gnssi][2][2]->currentIndex()-1;
                int freq13=ComboBoxFreqGNSS[gnssi][2][3]->currentIndex()-1;
                int freq0=ComboBoxFreqGNSS[gnssi][0][0]->currentIndex()-1;
                int freq01=ComboBoxFreqGNSS[gnssi][0][1]->currentIndex()-1;
                int freq02=ComboBoxFreqGNSS[gnssi][0][2]->currentIndex()-1;
                int freq03=ComboBoxFreqGNSS[gnssi][0][3]->currentIndex()-1;

                if (TripleQuadruple==0) {
                    if (freq1==freq0 && freq11==freq01 && freq12==freq02 ) {
                        if (ComboBoxMeasGNSS[gnssi][2][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][0][freq0]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][2][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][1][freq01]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][2][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][2][freq02]->currentIndex()) {
                            *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in Melbourne-Wübbena cycle-slip detector has iterations 1 and 3 repeated. They will be used only once.\n";
                            skipIteration[gnssi][2]=1;
                        }
                    }
                } else {
                    if (freq1==freq0 && freq11==freq01 && freq12==freq02 && freq13==freq03 ) {
                        if (ComboBoxMeasGNSS[gnssi][2][0][freq1]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][0][freq0]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][2][1][freq11]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][1][freq01]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][2][2][freq12]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][2][freq02]->currentIndex()
                                && ComboBoxMeasGNSS[gnssi][2][3][freq13]->currentIndex()==ComboBoxMeasGNSS[gnssi][0][3][freq03]->currentIndex()) {
                            *warningString += "PREPROCESS: " + GNSSName[gnssi] + " constellation in Melbourne-Wübbena cycle-slip detector has iterations 1 and 3 repeated. They will be used only once.\n";
                            skipIteration[gnssi][2]=1;
                        }
                    }
                }
            }
        }
       int freqflag=0;
       //loop of combinations
        for (int combi=0; combi<3; combi++){
            if (skipIteration[gnssi][combi]==1) continue; //Skip repetead combinations
            //get options if not hidden and frequency is specified
            if (FrameCombGNSS[gnssi][combi]->isHidden()==false && ComboBoxFreqGNSS[gnssi][combi][0]->currentIndex()!=0){
                int freq1=ComboBoxFreqGNSS[gnssi][combi][0]->currentIndex()-1;
                int freq2=ComboBoxFreqGNSS[gnssi][combi][1]->currentIndex()-1;
                int freq3=ComboBoxFreqGNSS[gnssi][combi][2]->currentIndex()-1;
                int freq4=ComboBoxFreqGNSS[gnssi][combi][3]->currentIndex()-1;
                //only specify frequency
                if (ComboBoxMeasGNSS[gnssi][combi][0][freq1]->currentIndex()==0){
                    if (freqflag==0){
                        freqOption += " " + indentifierGNSS[gnssi] + "0-" + FreqGNSSList[gnssi][freq1] + FreqGNSSList[gnssi][freq2] +
                                FreqGNSSList[gnssi][freq3] + (TripleQuadruple==0?"":FreqGNSSList[gnssi][freq4]);
                        freqflag=1;
                    } else {
                        freqOption += "." + FreqGNSSList[gnssi][freq1] + FreqGNSSList[gnssi][freq2] +
                                FreqGNSSList[gnssi][freq3] + (TripleQuadruple==0?"":FreqGNSSList[gnssi][freq4]);
                    }
                }
                //specify both frequency and measurement
                else {
                    measOption += " " + indentifierGNSS[gnssi] + "0-" +
                            ComboBoxMeasGNSS[gnssi][combi][0][freq1]->currentText() + "-" + ComboBoxMeasGNSS[gnssi][combi][1][freq2]->currentText() + "-" +
                            ComboBoxMeasGNSS[gnssi][combi][2][freq3]->currentText() +
                            ( TripleQuadruple==0? "" : ("-" + ComboBoxMeasGNSS[gnssi][combi][3][freq4]->currentText()) );
                }
            }
        }
    }
    //Merge by constellation frequency parameters
    freqOptionList = freqOption.split(QRegularExpression("\\s+"));
    numFreqOptionList = freqOptionList.count();
    for(int Param=0;Param<numFreqOptionList;Param++) {
        for(int Param2=0;Param2<numFreqOptionList;Param2++) {
            if (Param==Param2) continue;
            if (freqOptionList[Param]=="" || freqOptionList[Param2]=="") continue;
            int pos1,pos2;
            pos1=freqOptionList[Param].indexOf("-")+1;
            pos2=freqOptionList[Param2].indexOf("-")+1;

            if (QString::compare(freqOptionList[Param].mid(pos1),freqOptionList[Param2].mid(pos2))==0 ) {
                freqOptionList[Param].insert(pos1-2,freqOptionList[Param2].left(1));
                freqOptionList[Param2]="";
            }
        }
    }

    //Merge by constellation meas parameters
    measOptionList = measOption.split(QRegularExpression("\\s+"));
    numMeasOptionList = measOptionList.count();
    for(int Param=0;Param<numMeasOptionList;Param++) {
        for(int Param2=0;Param2<numMeasOptionList;Param2++) {
            if (Param==Param2) continue;
            if (measOptionList[Param]=="" || measOptionList[Param2]=="") continue;
            int pos1,pos2;
            pos1=measOptionList[Param].indexOf("-")+1;
            pos2=measOptionList[Param2].indexOf("-")+1;

            if (QString::compare(measOptionList[Param].mid(pos1),measOptionList[Param2].mid(pos2))==0 ) {
                measOptionList[Param].insert(pos1-2,measOptionList[Param2].left(1));
                measOptionList[Param2]="";
            }
        }
    }

    //-pre:cs:igf:freq
    int firstArg=1;
    for(int Param=0;Param<numFreqOptionList;Param++) {
        if (freqOptionList[Param]=="") continue;
        if (firstArg==1) {
            firstArg=0;
            *saveString += "-pre:cs:igf:freq";
            *runString << "-pre:cs:igf:freq";
        }
        *saveString += " " + freqOptionList[Param];
        *runString << freqOptionList[Param];
        paramCount++;
    }
    if (firstArg==0) *saveString += "\n";

    //-pre:cs:igf:meas
    firstArg=1;
    for(int Param=0;Param<numMeasOptionList;Param++) {
        if (measOptionList[Param]=="") continue;
        if (firstArg==1) {
            firstArg=0;
            *saveString += "-pre:cs:igf:meas";
            *runString << "-pre:cs:igf:meas";
        }
        *saveString += " " + measOptionList[Param];
        *runString << measOptionList[Param];
        paramCount++;
    }
    if (firstArg==0) *saveString += "\n";
    return paramCount;
}

//Function to convert IGF command options to GUI configuration
void GNSS_CS_IGF_Advanced::loadgLABOptions(QString *warningString, QStringList *ParametersList, const int freqMeas, const QRadioButton *MinNoiseButton){
    int setCount[MAX_GNSS]={0};
    int nPar=ParametersList->count();
    int nFreq=TripleQuadruple==0?3:4;
    //get former set
    for (int iGNSS=0; iGNSS<MAX_GNSS; iGNSS++){
        for (int icomb=0; icomb<3; icomb++){
            if (ComboBoxFreqGNSS[iGNSS][icomb][0]->currentIndex()>0) setCount[iGNSS]=icomb+1;
        }
    }
    //frequency
    if (freqMeas==1) {
        //loop parameters
        for (int iPar=0; iPar<nPar; iPar++){
            int iGNSS=-1;
            //Check parameter
            if (checkUserInputCycleSlipMeasurement(warningString,ParametersList->at(iPar),CStypeIGF,CStypeParamFreq,MinNoiseButton)) continue;
            //find frequency list
            QStringList FreqParList = ParametersList->at(iPar).split("-", QString::SkipEmptyParts);
            //get constellation
            for (iGNSS=0; iGNSS<MAX_GNSS; iGNSS++) {
                if (!FreqParList[0].toUpper().contains(indentifierGNSS[iGNSS]) && FreqParList[0]!="0" ) continue;
                QStringList freqComb = FreqParList.last().split(".",QString::SkipEmptyParts);
                //loop frequency
                for (int iCom=0; iCom<freqComb.count(); iCom++){
                    if (setCount[iGNSS]>2) {
                        *warningString += "PREPROCESS: Maximum number of iterations for " + GNSSName[iGNSS] + " IGF cycle-slip detector is 3. Argument '" + ParametersList->at(iPar) + "' was skipped for " + GNSSName[iGNSS] + " as limit has been surpassed.\n";
                        break;
                    }
                    if ( freqComb[iCom].size()!=nFreq ) continue;
                    int freq[4]={-1,-1,-1,-1};
                    //get 2 frequencies
                    for (int iF=0; iF<nFreq; iF++){
                        for (int ifreq=0; ifreq<nFreqGNSS[iGNSS]; ifreq++){
                            if (freqComb[iCom].mid(iF,1)==FreqGNSSList[iGNSS][ifreq]) {
                                freq[iF]=ifreq;
                                break;
                            }
                        }
                    }
                    if ( freq[0]<0 ) {
                        *warningString += "PREPROCESS: IGF cycle-slip frequency '" + freqComb[iCom].mid(0,1) + "' in argument '" + ParametersList->at(iPar) + "' does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                        continue;
                    } else if ( freq[1]<0 ) {
                        *warningString += "PREPROCESS: IGF cycle-slip frequency '" + freqComb[iCom].mid(1,1) + "' in argument '" + ParametersList->at(iPar) + "' does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                        continue;
                    } else if ( freq[2]<0 ) {
                        *warningString += "PREPROCESS: IGF cycle-slip frequency '" + freqComb[iCom].mid(2,1) + "' in argument '" + ParametersList->at(iPar) + "' does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                        continue;
                    } else if ( freq[3]<0 ) {
                        if (nFreq==4) {
                            *warningString += "PREPROCESS: IGF cycle-slip frequency '" + freqComb[iCom].mid(1,1) + "' in argument '" + ParametersList->at(iPar) + "' does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                            continue;
                        }
                    }

                    if ( this->checkFreqRepeat(freq[0]+1,freq[1]+1,freq[2]+1,freq[3]+1) ) continue;
                    FrameCombGNSS[iGNSS][setCount[iGNSS]]->setHidden(false);
                    for (int iF=0; iF<nFreq; iF++){
                        ComboBoxFreqGNSS[iGNSS][setCount[iGNSS]][iF]->setCurrentIndex(freq[iF]+1);
                    }
                    setCount[iGNSS]++;
                }
            }
        }
    }
    //measurement
    else {
        //loop parameters
        for (int iPar=0; iPar<nPar; iPar++){
            int iGNSS=-1,measStart=0;
            //Check parameter
            if (checkUserInputCycleSlipMeasurement(warningString,ParametersList->at(iPar),CStypeIGF,CStypeParamMeas,MinNoiseButton)) continue;
            //find measurement list
            QStringList MeasParList = ParametersList->at(iPar).split("-", QString::SkipEmptyParts);
            measStart=MeasParList.count()-nFreq;
            if (measStart<1) continue;
            //get constellation
            for (iGNSS=0; iGNSS<MAX_GNSS; iGNSS++) {
                if (!MeasParList[0].toUpper().contains(indentifierGNSS[iGNSS]) && MeasParList[0]!="0" ) continue;
                if (setCount[iGNSS]>2 ) {
                    *warningString += "PREPROCESS: Maximum number of iterations for " + GNSSName[iGNSS] + " IGF cycle-slip detector is 3. Argument '" + ParametersList->at(iPar) + "' was skipped for " + GNSSName[iGNSS] + " as limit has been surpassed.\n";
                    continue;
                }
                //get frequency & measurement
                int freq12[4]={-1,-1,-1,-1},meas12[4]={-1,-1,-1,-1};
                for (int iFM=0; iFM<nFreq; iFM++){
                    if ( MeasParList[measStart+iFM].mid(0,1)!="L" || MeasParList[measStart+iFM].size()!=3 ) {
                        break;
                    }
                    for (int ifreq=0; ifreq<nFreqGNSS[iGNSS]; ifreq++){
                        if (MeasParList[measStart+iFM].mid(1,1)==FreqGNSSList[iGNSS][ifreq]) {
                            freq12[iFM]=ifreq;
                        }
                    }
                    if ( freq12[iFM]<0) {
                        *warningString += "PREPROCESS: Frequency '" + MeasParList[measStart+iFM].mid(1,1) + "' in measurement '" + MeasParList[measStart+iFM] + "' in argument '" + ParametersList->at(iPar) + "' for IGF cycle-slip detector does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                        break;
                    }
                    for (int imeas=0; imeas<MeasGNSSOrder[iGNSS][freq12[iFM]].size(); imeas++){
                        if (MeasParList[measStart+iFM].toUpper().mid(2,1)==MeasGNSSOrder[iGNSS][freq12[iFM]].mid(imeas,1)) {
                            meas12[iFM]=imeas;
                        }
                    }
                    if (meas12[iFM]<0) {
                        *warningString += "PREPROCESS: Measurement '" + MeasParList[measStart+iFM] + "' in argument '" + ParametersList->at(iPar) + "' for IGF cycle-slip detector does not exist for " + GNSSName[iGNSS] + ". It was skipped.\n";
                    }
                }
                if (TripleQuadruple==0) {
                    if ( meas12[0]<0 || meas12[1]<0 || meas12[2]<0 ) continue;
                } else {
                    if ( meas12[0]<0 || meas12[1]<0 || meas12[2]<0 || meas12[3]<0 ) continue;
                }
                if ( this->checkFreqRepeat(freq12[0]+1,freq12[1]+1,freq12[2]+1,freq12[3]+1) ) continue;
                FrameCombGNSS[iGNSS][setCount[iGNSS]]->setHidden(false);
                ComboBoxFreqGNSS[iGNSS][setCount[iGNSS]][0]->setCurrentIndex(freq12[0]+1);
                ComboBoxFreqGNSS[iGNSS][setCount[iGNSS]][1]->setCurrentIndex(freq12[1]+1);
                ComboBoxFreqGNSS[iGNSS][setCount[iGNSS]][2]->setCurrentIndex(freq12[2]+1);

                ComboBoxMeasGNSS[iGNSS][setCount[iGNSS]][0][freq12[0]]->setCurrentIndex(meas12[0]+1);
                ComboBoxMeasGNSS[iGNSS][setCount[iGNSS]][1][freq12[1]]->setCurrentIndex(meas12[1]+1);
                ComboBoxMeasGNSS[iGNSS][setCount[iGNSS]][2][freq12[2]]->setCurrentIndex(meas12[2]+1);
                if (TripleQuadruple==1) {
                    ComboBoxFreqGNSS[iGNSS][setCount[iGNSS]][3]->setCurrentIndex(freq12[3]+1);
                    ComboBoxMeasGNSS[iGNSS][setCount[iGNSS]][3][freq12[3]]->setCurrentIndex(meas12[3]+1);
                }
                setCount[iGNSS]++;
            }
        }
    }
    //Change to Galileo constellation and then back to GPS to make sure "+" and "-" are in consistent state
    this->on_pushButtonGalileo_clicked();
    this->on_pushButtonGPS_clicked();
}

void GNSS_CS_IGF_Advanced::on_pushButtonCSIGFAdvancedDefault_clicked(){
    setCSdefaults();
}
void GNSS_CS_IGF_Advanced::on_pushButtonCSIGFAdvancedOk_clicked(){
    this->OkFlag=1;
    this->close();
}
void GNSS_CS_IGF_Advanced::on_pushButtonCSIGFAdvancedCancel_clicked(){
    this->OkFlag=0;
    this->close();
}
